import React, { Fragment } from 'react';
import styles from '../../styles/Home.module.css';

// Project Component
import InputProject from './InputProject';
import ListProject from './ListProject';


const ProjectMain = () => {
    return(
        <Fragment>
        <head>
        <InputProject/>
        </head>
        <div>
            <ListProject/>
        </div>
        </Fragment>
    )
}

export default ProjectMain;
